import React from "react";

import ReactDOM from 'react-dom';

import Grid from '@material-ui/core/Grid';

import Footer from "react-footer-comp";

import { SocialIcon } from 'react-social-icons';

import StickyFooter from 'react-sticky-footer';

const bottomFooter = () => {
  return (
<div>
    <Footer
        bgColor={"orangered"}
        textStyle={{ color: "yellow", fontSize: 16, padding: 10 }}
        width={400}
        height={150}
        alignItems="left"
        text={
    <Grid container
            spacing={3}
            direction="row"
            alignItems="center"
            justify="center"
    >
    <Grid item md={3}>
    <h3>walkerkeatley@yahoo.com</h3>
    </Grid>
    <Grid item lg={3}>
        <h3>Follow me on Social Media:</h3>
        <SocialIcon url="https://twitter.com/blackfalcon_unc" />
        <SocialIcon url="https://www.instagram.com/floyds_fotos/" />
        <SocialIcon url="https://github.com/walkerfloyd1" />
        <SocialIcon url="https://www.linkedin.com/in/walker-floyd-b53182123/" />
    </Grid>
        </Grid>}
        />
</div>
  );
}

export default bottomFooter;
